import React from "react"
import styles from "./Topdeals.module.css"

import image1 from "./Extras/topdealsimage1.webp"
import leftbtn from "./Extras/leftbtn.png"
import rightbtn from "./Extras/rightbtn.png"

export class Topdeals extends React.Component{
  constructor(){
    super()

    this.state={
      imageslider:[image1]
    }
  }

  render(){

    return(
      <React.Fragment>
      <div className={styles.imageSlider}>
      <img src={image1}/>
      <button className={styles.leftbtn}>
      <img src={leftbtn}/>
      </button>
      <button className={styles.rightbtn}>
      <img src={rightbtn}/>
      </button>
      </div>
      </React.Fragment>
      )
  }

}
